version=\\\"1.0\\\" encoding=\\\"utf-8\\\" standalone=\\\"yes\\\" ?>\\n<T3FlexForms>\\n    <data>\\n        <sheet index=\\\"sDEF\\\">\\n            <language index=\\\"lDEF\\\">\\n                <field index=\\\"settings.persistenceIdentifier\\\">\\n                    <value index=\\\"vDEF\\\">1:\\/form_definitions\\/kontaktDFG-Viewer.form.yaml<\\/value>\\n                <\\/field>\\n                <field index=\\\"settings.overrideFinishers\\\">\\n                    <value index=\\\"vDEF\\\">0<\\/value>\\n                <\\/field>\\n            <\\/language>\\n        <\\/sheet>\\n    <\\/data>\\n<\\/T3FlexForms>\\\";s:6:\\\"layout\\\";i:0;s:11:\\\"frame_class\\\";s:7:\\\"default\\\";s:18:\\\"space_before_class\\\";s:0:\\\"\\\";s:17:\\\"space_after_class\\\";s:0:\\\"\\\";s:12:\\\"sectionIndex\\\";i:1;s:9:\\\"linkToTop\\\";i:0;s:16:\\\"sys_language_uid\\\";i:0;s:11:\\\"l18n_parent\\\";i:0;s:8:\\\"fe_group\\\";s:0:\\\"\\\";s:8:\\\"editlock\\\";i:0;s:10:\\\"categories\\\";i:0;s:14:\\\"rowDescription\\\";s:0:\\\"\\\";}\"},\"newRecord\":{\"l18n_parent\":\"83\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"}}',0),(3952,0,1628603221,2,'BE',1,0,82,'tt_content','{\"oldRecord\":{\"l18n_parent\":0,\"l18n_diffsource\":\"a:24:{s:11:\\\"l18n_parent\\\";i:0;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:824:\\\"<p>Als Plattform f\\u00fcr Diskussion, Hilfe und Erfahrungsaustausch wurde eine&nbsp;<a class=\\\"link-internal\\\" href=\\\"t3:\\/\\/page?uid=16\\\">Mailingliste<\\/a>&nbsp;eingerichtet, die jedem Interessierten offen stehen. Bei weitergehenden Fragen und Problemen f\\u00fcllen Sie bitte das folgende Formular aus. Oder schreiben Sie an <a class=\\\"link-mail\\\" href=\\\"mailto:kontakt@dfg-viewer.de\\\">kontakt@dfg-viewer.de<\\/a>.<\\/p>\\r\\n<p class=\\\"abstract\\\">Ihre Nachricht erreicht den Betreiber des hier angebotenen Webdienstes, nicht aber den Anbieter der damit pr\\u00e4sentierten Digitalisate. <strong>Wenn Sie Fragen zu einem konkreten Dokument haben, wenden Sie sich daher bitte an den jeweiligen Inhalte-Anbieter.<\\/strong> Wer das ist, k\\u00f6nnen Sie am Logo oben links erkennen. Direkt neben dem Logo finden Sie auch die entsprechenden Kontaktm\\u00f6glichkeiten.<\\/p>\\\";s:5:\\\"CType\\\";s:4:\\\"text\\\";s:6:\\\"colPos\\\";i:0;s:6:\\\"header\\\";s:0:\\\"\\\";s:13:\\\"header_layout\\\";s:1:\\\"3\\\";s:15:\\\"header_position\\\";s:0:\\\"\\\";s:4:\\\"date\\\";i:0;s:11:\\\"header_link\\\";s:0:\\\"\\\";s:9:\\\"subheader\\\";s:0:\\\"\\\";s:6:\\\"layout\\\";i:0;s:11:\\\"frame_class\\\";s:7:\\\"default\\\";s:18:\\\"space_before_class\\\";s:0:\\\"\\\";s:17:\\\"space_after_class\\\";s:0:\\\"\\\";s:12:\\\"sectionIndex\\\";i:1;s:9:\\\"linkToTop\\\";i:0;s:16:\\\"sys_language_uid\\\";i:0;s:6:\\\"hidden\\\";i:0;s:8:\\\"fe_group\\\";s:0:\\\"\\\";s:8:\\\"editlock\\\";i:0;s:10:\\\"categories\\\";i:0;s:14:\\\"rowDescription\\\";N;}\"},\"newRecord\":{\"l18n_parent\":\"85\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"}}',0),(3953,0,1628603221,2,'BE',1,0,80,'tt_content','{\"oldRecord\":{\"l18n_parent\":0},\"newRecord\":{\"l18n_parent\":\"81\"}}',0),(3954,0,1628603221,2,'BE',1,0,78,'tt_content','{\"oldRecord\":{\"l18n_parent\":0,\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:1917:\\\"Zum Interessens- und Erfahrungsaustausch sowie zur Verst\\u00e4ndigung \\u00fcber k\\u00fcnftige Entwicklungsziele, zur Er\\u00f6rterung technischer Fragen und zur kollaborativen Probleml\\u00f6sung wurde eine Mailingliste eingerichtet.\\r\\n<h3>Mailingliste<\\/h3>\\r\\nDiese Mailingliste behandelt allgemeine Fragen und dient der Verst\\u00e4ndigung \\u00fcber Themen rund um die <acronym title=\\\"Deutsche Forschungsgemeinschaft\\\">DFG<\\/acronym>-gef\\u00f6rderte (Massen-)Digitalisierung, den <i><acronym title=\\\"Deutsche Forschungsgemeinschaft\\\">DFG<\\/acronym>-Viewer<\\/i> und andere Aspekte der <acronym title=\\\"Deutsche Forschungsgemeinschaft\\\">DFG<\\/acronym>-Praxisregeln. Au\\u00dferdem behandelt sie die technischen Fragen des <i><acronym title=\\\"Deutsche  Forschungsgemeinschaft\\\">DFG<\\/acronym>-Viewers<\\/i>, der Datenformate und  deren Implementierung und Weiterentwicklung.<br \\/>Um die Mailingliste zu abonnieren, schicken Sie eine E-Mail an <LINK dv-technik-join@dfg-viewer.de>dv-technik-join@dfg-viewer.de<\\/link>. Sie erhalten dann eine E-Mail, auf die Sie zur Best\\u00e4tigung Ihres Abonnements lediglich antworten m\\u00fcssen. Damit sind Sie fortan Mitglied der Mailingliste, erhalten automatisch alle Listen-Mails und k\\u00f6nnen auch selbst E-Mails an die Listenmitglieder schreiben. Das Abonnement ist selbstverst\\u00e4ndlich kostenlos und kann jederzeit durch eine E-Mail an die Adresse <LINK dv-technik-leave@dfg-viewer.de>dv-technik-leave@dfg-viewer.de<\\/link> gek\\u00fcndigt werden.<br \\/>Als Listenabonnent k\\u00f6nnen Sie E-Mails an alle Listenmitglieder schreiben, in dem Sie Ihre E-Mail an die Adresse <LINK technik@dfg-viewer.de>technik@dfg-viewer.de<\\/link> richten.\\r\\n<h3>Archiv<\\/h3>\\r\\nDas <LINK https:\\/\\/maillist.slub-dresden.de\\/pipermail\\/dv-technik\\/ - external>Archiv der Mailingliste<\\/link> kann auch ohne Abonnement gelesen werden. Zur Suche im Archiv empfiehlt sich eine Google-Suche mit dem zus\\u00e4tzlichen Parameter &quot;inurl:maillist.slub-dresden.de\\/pipermail\\/dv-technik\\/&quot;.\\\";}\"},\"newRecord\":{\"l18n_parent\":\"79\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"}}',0),(3955,0,1628603221,2,'BE',1,0,76,'tt_content','{\"oldRecord\":{\"l18n_parent\":0,\"l18n_diffsource\":\"a:24:{s:11:\\\"l18n_parent\\\";i:0;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:2571:\\\"<p>Die nachstehenden Informationen enthalten die gesetzlich vorgesehenen Pflichtangaben zur Anbieterkennzeichnung, sowie wichtige rechtliche Hinweise zur Internetpr\\u00e4senz des Projekts <em>DFG-Viewer<\\/em>.<\\/p>\\r\\n<h3>Anbieter<\\/h3>\\r\\n<p><strong>S\\u00e4chsische Landesbibliothek -<br \\/> Staats- und Universit\\u00e4tsbibliothek Dresden<\\/strong> (SLUB)<br \\/> Zellescher Weg 18<br \\/> 01069 Dresden<br \\/> Tel.: +49 351 4677-123<br \\/> Fax: +49 351 4677-111<br \\/> E-Mail: <a href=\\\"mailto:direktion@slub-dresden.de\\\">direktion@slub-dresden.de<\\/a><br \\/> Internet: <a class=\\\"external\\\" href=\\\"http:\\/\\/www.slub-dresden.de\\/\\\" title=\\\"SLUB Dresden\\\">www.slub-dresden.de<\\/a><br \\/> Umsatzsteueridentifikationsnummer: DE 190021717<\\/p>\\r\\n<h3>Projektpartner<\\/h3>\\r\\n<p><strong>Herzog August Bibliothek<\\/strong><br \\/> Lessingplatz 1<br \\/> 38304 Wolfenb\\u00fcttel<br \\/> Internet: <a class=\\\"external\\\" href=\\\"http:\\/\\/www.hab.de\\/\\\" title=\\\"HAB Wolfenb\\u00fcttel\\\">www.hab.de<\\/a><\\/p>\\r\\n<p><strong>Universit\\u00e4ts- und Landesbibliothek Sachsen-Anhalt<\\/strong><br \\/> August-Bebel-Stra\\u00dfe 13\\/50<br \\/> 06108 Halle (Saale)<br \\/> Internet: <a class=\\\"external\\\" href=\\\"http:\\/\\/www.bibliothek.uni-halle.de\\/\\\" title=\\\"ULB Sachsen-Anhalt\\\">www.bibliothek.uni-halle.de<\\/a><\\/p>\\r\\n<p><strong>Bayerische Staatsbibliothek<\\/strong><br \\/> Ludwigstra\\u00dfe 16<br \\/> 80539 M\\u00fcnchen<br \\/> Internet: <a class=\\\"external\\\" href=\\\"http:\\/\\/www.bsb-muenchen.de\\/\\\" title=\\\"BSB M\\u00fcnchen\\\">www.bsb-muenchen.de<\\/a><\\/p>\\r\\n<h3>Technische Realisierung<\\/h3>\\r\\n<p>S\\u00e4chsische Landesbibliothek -<br \\/> Staats- und Universit\\u00e4tsbibliothek Dresden<br \\/> Referat Digitale Pr\\u00e4sentation<br \\/> E-Mail: <a class=\\\"link-mail\\\" href=\\\"mailto:kontakt@dfg-viewer.de\\\">kontakt@dfg-viewer.de<\\/a><br \\/> &nbsp;<\\/p>\\r\\n<h3>Grafische Gestaltung<\\/h3>\\r\\n<p><strong>Thomas Jung<\\/strong><br \\/> <a href=\\\"https:\\/\\/jung.digital\\/\\\">https:\\/\\/jung.digital\\/<\\/a><\\/p>\\r\\n<h3><br \\/> Rechtliche Hinweise zur Haftung<\\/h3>\\r\\n<p>Trotz unserer sorgf\\u00e4ltigen Bem\\u00fchungen k\\u00f6nnen wir keine Gew\\u00e4hr f\\u00fcr die Richtigkeit, Vollst\\u00e4ndigkeit und Aktualit\\u00e4t unserer Webseiten geben. Weiter \\u00fcbernehmen wir keine Haftung f\\u00fcr die Inhalte externer Links. F\\u00fcr den Inhalt der verlinkten Seiten sind ausschlie\\u00dflich deren Betreiber verantwortlich. Die SLUB beh\\u00e4lt es sich vor, Teile des Internetangebotes oder das gesamte Angebot ohne gesonderte Ank\\u00fcndigung zu \\u00e4ndern, zu erg\\u00e4nzen, zu l\\u00f6schen oder die Ver\\u00f6ffentlichung zeitweise oder endg\\u00fcltig einzustellen.<\\/p>\\r\\n<h3>Rechtliche Hinweise zum Urheberrecht<\\/h3>\\r\\n<p>Das Layout und Design der Webseiten, die verwendeten Grafiken sowie die sonstigen Inhalte sind urheberrechtlich gesch\\u00fctzt.<\\/p>\\\";s:5:\\\"CType\\\";s:4:\\\"text\\\";s:6:\\\"colPos\\\";i:0;s:6:\\\"header\\\";s:0:\\\"\\\";s:13:\\\"header_layout\\\";s:1:\\\"3\\\";s:15:\\\"header_position\\\";s:0:\\\"\\\";s:4:\\\"date\\\";i:0;s:11:\\\"header_link\\\";s:0:\\\"\\\";s:9:\\\"subheader\\\";s:0:\\\"\\\";s:6:\\\"layout\\\";i:0;s:11:\\\"frame_class\\\";s:7:\\\"default\\\";s:18:\\\"space_before_class\\\";s:0:\\\"\\\";s:17:\\\"space_after_class\\\";s:0:\\\"\\\";s:12:\\\"sectionIndex\\\";i:1;s:9:\\\"linkToTop\\\";i:0;s:16:\\\"sys_language_uid\\\";i:0;s:6:\\\"hidden\\\";i:0;s:8:\\\"fe_group\\\";s:0:\\\"\\\";s:8:\\\"editlock\\\";i:0;s:10:\\\"categories\\\";i:0;s:14:\\\"rowDescription\\\";N;}\"},\"newRecord\":{\"l18n_parent\":\"77\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"}}',0),(3956,0,1628603221,2,'BE',1,0,74,'tt_content','{\"oldRecord\":{\"l18n_parent\":0},\"newRecord\":{\"l18n_parent\":\"75\"}}',0),(3957,0,1628603221,2,'BE',1,0,73,'tt_content','{\"oldRecord\":{\"l18n_parent\":0,\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:968:\\\"<ul> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#67\\\">Allgemeine Angaben<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#66\\\">Verarbeitung der Daten<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#65\\\">Kontaktm\\u00f6glichkeiten und Anfragen<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#64\\\">Online-Anmeldung<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#63\\\">Blog mit Kommentarfunktion<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#62\\\">Anmeldung zu Veranstaltungen<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#61\\\">Cookies<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#60\\\">Analyse unserer Website<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#58\\\">Eingebundene Dienste und Inhalte Dritter<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#57\\\">Widerruf der Einwilligung<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#56\\\">Ihre Rechte<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#55\\\">Widerspruchsrecht<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#54\\\">Datenschutzbeauftragter<\\/a><\\/li> \\t<li><a href=\\\"t3:\\/\\/page?uid=32#53\\\">Beschwerde bei einer Aufsichtsbeh\\u00f6rde<\\/a><\\/li> <\\/ul>\\\";}\"},\"newRecord\":{\"l18n_parent\":\"57\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"}}',0),(3958,0,1628603221,2,'BE',1,0,72,'tt_content','{\"oldRecord\":{\"l18n_parent\":0,\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:2556:\\\"<h4>Kontakt<\\/h4>\\r\\n<div>Wenn Sie Fragen oder Anregungen zu diesen Informationen haben oder sich wegen der Geltendmachung Ihrer Rechte an uns wenden m\\u00f6chten, richten Sie Ihre Anfrage bitte an: <\\/div>\\r\\n<div><b>S\\u00e4chsische Landesbibliothek \\u2013 Staats- und Universit\\u00e4tsbibliothek Dresden<br \\/>Zellescher Weg 18, 01069 Dresden<\\/b><br \\/>Tel.: +49 351 4677 123<br \\/>E-Mail: <LINK Generaldirektion@slub-dresden.de>Generaldirektion@slub-dresden.de<\\/link> <\\/div>\\r\\n<h4>Allgemeine Angaben zur Datenverarbeitung<\\/h4>\\r\\n<div>Bei der Nutzung dieser Website kann es zu einer Verarbeitung von personenbezogenen Daten kommen. Der datenschutzrechtliche Begriff \\u201epersonenbezogene Daten\\u201c bezeichnet dabei alle Informationen, die sich auf einen bestimmten oder bestimmbaren Menschen beziehen. Auch die IP-Adresse kann so ein personenbezogenes Datum sein. Eine IP-Adresse wird jedem mit dem Internet verbundenen Ger\\u00e4t durch den Internetprovider zugewiesen, damit es Daten senden und empfangen kann. Bei der Nutzung der Website erfassen wir Informationen, die Sie selbst bereitstellen. Au\\u00dferdem werden w\\u00e4hrend Ihres Besuchs auf der Website automatisch bestimmte Informationen \\u00fcber Ihre Nutzung der Website durch uns erfasst.<br \\/><br \\/><\\/div>\\r\\n<div>Wir verarbeiten personenbezogene Daten unter Beachtung der einschl\\u00e4gigen Datenschutzvorschriften, insbesondere der DSGVO und des BDSG. Eine Datenverarbeitung durch uns findet nur auf der Grundlage einer gesetzlichen Erlaubnis statt. Bei der Nutzung dieser Website verarbeiten wir personenbezogene Daten nur mit Ihrer Einwilligung (Art. 6 Abs. 1 S. 1 a DSGVO), zur Erf\\u00fcllung eines Vertrags, dessen Vertragspartei Sie sind, oder auf Ihre Anfrage zur Durchf\\u00fchrung vorvertraglicher Ma\\u00dfnahmen (Art. 6 Abs. 1 S. 1 b DSGVO), zur Erf\\u00fcllung einer rechtlichen Verpflichtung (Art. 6 Abs.1 S. 1 c DSGVO) oder wenn die Verarbeitung zu Wahrung unser berechtigten Interessen oder den berechtigten Interessen eines Dritten erforderlich ist, sofern nicht Ihre Interessen oder Grundrechte und Grundfreiheiten, die den Schutz personenbezogener Daten erfordern, \\u00fcberwiegen (Art. 6 Abs. 1 S. 1 f DSGVO).&nbsp;<\\/div>\\r\\n<h4>Dauer der Speicherung<\\/h4>\\r\\n<div>Sofern sich aus den