\u00fcr Diskussion, Hilfe und Erfahrungsaustausch wurde eine&nbsp;<a class=\\\"link-internal\\\" href=\\\"41\\\">Mailingliste<\\/a>&nbsp;eingerichtet, die jedem Interessierten offen stehen. Bei weitergehenden Fragen und Problemen f\\u00fcllen Sie bitte das folgende Formular aus. Oder schreiben Sie an <a class=\\\"link-mail\\\" href=\\\"kontakt@dfg-viewer.de\\\">kontakt@dfg-viewer.de<\\/a>.<\\/p>\\r\\n<p class=\\\"abstract\\\">Ihre Nachricht erreicht den Betreiber des hier angebotenen Webdienstes, nicht aber den Anbieter der damit pr\\u00e4sentierten Digitalisate. <strong>Wenn Sie Fragen zu einem konkreten Dokument haben, wenden Sie sich daher bitte an den jeweiligen Inhalte-Anbieter.<\\/strong> Wer das ist, k\\u00f6nnen Sie am Logo oben links erkennen. Direkt neben dem Logo finden Sie auch die entsprechenden Kontaktm\\u00f6glichkeiten.<\\/p>\\\";}\"}}',0),(4203,0,1628603221,2,'BE',1,0,78,'tt_content','{\"oldRecord\":{\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"},\"newRecord\":{\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:1917:\\\"Zum Interessens- und Erfahrungsaustausch sowie zur Verst\\u00e4ndigung \\u00fcber k\\u00fcnftige Entwicklungsziele, zur Er\\u00f6rterung technischer Fragen und zur kollaborativen Probleml\\u00f6sung wurde eine Mailingliste eingerichtet.\\r\\n<h3>Mailingliste<\\/h3>\\r\\nDiese Mailingliste behandelt allgemeine Fragen und dient der Verst\\u00e4ndigung \\u00fcber Themen rund um die <acronym title=\\\"Deutsche Forschungsgemeinschaft\\\">DFG<\\/acronym>-gef\\u00f6rderte (Massen-)Digitalisierung, den <i><acronym title=\\\"Deutsche Forschungsgemeinschaft\\\">DFG<\\/acronym>-Viewer<\\/i> und andere Aspekte der <acronym title=\\\"Deutsche Forschungsgemeinschaft\\\">DFG<\\/acronym>-Praxisregeln. Au\\u00dferdem behandelt sie die technischen Fragen des <i><acronym title=\\\"Deutsche  Forschungsgemeinschaft\\\">DFG<\\/acronym>-Viewers<\\/i>, der Datenformate und  deren Implementierung und Weiterentwicklung.<br \\/>Um die Mailingliste zu abonnieren, schicken Sie eine E-Mail an <LINK dv-technik-join@dfg-viewer.de>dv-technik-join@dfg-viewer.de<\\/link>. Sie erhalten dann eine E-Mail, auf die Sie zur Best\\u00e4tigung Ihres Abonnements lediglich antworten m\\u00fcssen. Damit sind Sie fortan Mitglied der Mailingliste, erhalten automatisch alle Listen-Mails und k\\u00f6nnen auch selbst E-Mails an die Listenmitglieder schreiben. Das Abonnement ist selbstverst\\u00e4ndlich kostenlos und kann jederzeit durch eine E-Mail an die Adresse <LINK dv-technik-leave@dfg-viewer.de>dv-technik-leave@dfg-viewer.de<\\/link> gek\\u00fcndigt werden.<br \\/>Als Listenabonnent k\\u00f6nnen Sie E-Mails an alle Listenmitglieder schreiben, in dem Sie Ihre E-Mail an die Adresse <LINK technik@dfg-viewer.de>technik@dfg-viewer.de<\\/link> richten.\\r\\n<h3>Archiv<\\/h3>\\r\\nDas <LINK https:\\/\\/maillist.slub-dresden.de\\/pipermail\\/dv-technik\\/ - external>Archiv der Mailingliste<\\/link> kann auch ohne Abonnement gelesen werden. Zur Suche im Archiv empfiehlt sich eine Google-Suche mit dem zus\\u00e4tzlichen Parameter &quot;inurl:maillist.slub-dresden.de\\/pipermail\\/dv-technik\\/&quot;.\\\";}\"}}',0),(4204,0,1628603221,2,'BE',1,0,77,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>Die nachstehenden Informationen enthalten die gesetzlich vorgesehenen Pflichtangaben zur Anbieterkennzeichnung, sowie wichtige rechtliche Hinweise zur Internetpr\\u00e4senz des Projekts <em>DFG-Viewer<\\/em>.<\\/p>\\r\\n<h3>Anbieter<\\/h3>\\r\\n<p><strong>S\\u00e4chsische Landesbibliothek -<br \\/> Staats- und Universit\\u00e4tsbibliothek Dresden<\\/strong> (SLUB)<br \\/> Zellescher Weg 18<br \\/> 01069 Dresden<br \\/> Tel.: +49 351 4677-123<br \\/> Fax: +49 351 4677-111<br \\/> E-Mail: <a href=\\\"mailto:direktion@slub-dresden.de\\\">direktion@slub-dresden.de<\\/a><br \\/> Internet: <a class=\\\"external\\\" href=\\\"http:\\/\\