akt@dfg-viewer.de<\\/a><br \\/> &nbsp;<\\/p>\\r\\n<h3>Grafische Gestaltung<\\/h3>\\r\\n<p><strong>Thomas Jung<\\/strong><br \\/> <a href=\\\"https:\\/\\/jung.digital\\/\\\">https:\\/\\/jung.digital\\/<\\/a><\\/p>\\r\\n<h3><br \\/> Rechtliche Hinweise zur Haftung<\\/h3>\\r\\n<p>Trotz unserer sorgf\\u00e4ltigen Bem\\u00fchungen k\\u00f6nnen wir keine Gew\\u00e4hr f\\u00fcr die Richtigkeit, Vollst\\u00e4ndigkeit und Aktualit\\u00e4t unserer Webseiten geben. Weiter \\u00fcbernehmen wir keine Haftung f\\u00fcr die Inhalte externer Links. F\\u00fcr den Inhalt der verlinkten Seiten sind ausschlie\\u00dflich deren Betreiber verantwortlich. Die SLUB beh\\u00e4lt es sich vor, Teile des Internetangebotes oder das gesamte Angebot ohne gesonderte Ank\\u00fcndigung zu \\u00e4ndern, zu erg\\u00e4nzen, zu l\\u00f6schen oder die Ver\\u00f6ffentlichung zeitweise oder endg\\u00fcltig einzustellen.<\\/p>\\r\\n<h3>Rechtliche Hinweise zum Urheberrecht<\\/h3>\\r\\n<p>Das Layout und Design der Webseiten, die verwendeten Grafiken sowie die sonstigen Inhalte sind urheberrechtlich gesch\\u00fctzt.<\\/p>\\\";}\"}}',0),(4206,0,1628603221,2,'BE',1,0,72,'tt_content','{\"oldRecord\":{\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"},\"newRecord\":{\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:2556:\\\"<h4>Kontakt<\\/h4>\\r\\n<div>Wenn Sie Fragen oder Anregungen zu diesen Informationen haben oder sich wegen der Geltendmachung Ihrer Rechte an uns wenden m\\u00f6chten, richten Sie Ihre Anfrage bitte an: <\\/div>\\r\\n<div><b>S\\u00e4chsische Landesbibliothek \\u2013 Staats- und Universit\\u00e4tsbibliothek Dresden<br \\/>Zellescher Weg 18, 01069 Dresden<\\/b><br \\/>Tel.: +49 351 4677 123<br \\/>E-Mail: <LINK Generaldirektion@slub-dresden.de>Generaldirektion@slub-dresden.de<\\/link> <\\/div>\\r\\n<h4>Allgemeine Angaben zur Datenverarbeitung<\\/h4>\\r\\n<div>Bei der Nutzung dieser Website kann es zu einer Verarbeitung von personenbezogenen Daten kommen. Der datenschutzrechtliche Begriff \\u201epersonenbezogene Daten\\u201c bezeichnet dabei alle Informationen, die sich auf einen bestimmten oder bestimmbaren Menschen beziehen. Auch die IP-Adresse kann so ein personenbezogenes Datum sein. Eine IP-Adresse wird jedem mit dem Internet verbundenen Ger\\u00e4t durch den Internetprovider zugewiesen, damit es Daten senden und empfangen kann. Bei der Nutzung der Website erfassen wir Informationen, die Sie selbst bereitstellen. Au\\u00dferdem werden w\\u00e4hrend Ihres Besuchs auf der Website automatisch bestimmte Informationen \\u00fcber Ihre Nutzung der Website durch uns erfasst.<br \\/><br \\/><\\/div>\\r\\n<div>Wir verarbeiten personenbezogene Daten unter Beachtung der einschl\\u00e4gigen Datenschutzvorschriften, insbesondere der DSGVO und des BDSG. Eine Datenverarbeitung durch uns findet nur auf der Grundlage einer gesetzlichen Erlaubnis statt. Bei der Nutzung dieser Website verarbeiten wir personenbezogene Daten nur mit Ihrer Einwilligung (Art. 6 Abs. 1 S. 1 a DSGVO), zur Erf\\u00fcllung eines Vertrags, dessen Vertragspartei Sie sind, oder auf Ihre Anfrage zur Durchf\\u00fchrung vorvertraglicher Ma\\u00dfnahmen (Art. 6 Abs. 1 S. 1 b DSGVO), zur Erf\\u00fcllung einer rechtlichen Verpflichtung (Art. 6 Abs.1 S. 1 c DSGVO) oder wenn die Verarbeitung zu Wahrung unser berechtigten Interessen oder den berechtigten Interessen eines Dritten erforderlich ist, sofern nicht Ihre Interessen oder Grundrechte und Grundfreiheiten, die den Schutz personenbezogener Daten erfordern, \\u00fcberwiegen (Art. 6 Abs. 1 S. 1 f DSGVO).&nbsp;<\\/div>\\r\\n<h4>Dauer der Speicherung<\\/h4>\\r\\n<div>Sofern sich aus den folgenden Hinweisen nichts Anderes ergibt, speichern wir die Daten nur solange, wie es zur Erreichung des Verarbeitungszwecks oder f\\u00fcr die Erf\\u00fcllung unserer vertraglichen oder gesetzlichen Pflichten erforderlich ist. Solche gesetzlichen Aufbewahrungspflichten k\\u00f6nnen sich insbesondere aus handels- oder steuerrechtlichen Vorschriften ergeben.<\\/div>\\r\\n<div><\\/div>\\\";}\"}}',0),(4207,0,1628603221,2,'BE',1,0,70,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>Our website includes a <a class=\\\"link-internal\\\" href=\\\"t3:\\/\\/page?uid=14\\\">contact form<\\/a>, by means of which you can send us news. In this process your data is transferred in an encrypted form. All the data fields marked as mandatory must be filled out in order to allow us to process your request. If you do not provide this information, we are unable to process your request. Any further provision of data is voluntary. We process the data for the purpose of responding to your enquiry.<\\/p>\\r\\n<p>The legal base for the data processing is Article 6 (1) 1st sentence point (b) GDPR.<\\/p>\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"},\"newRecord\":{\"bodytext\":\"<p>Our website includes a <a class=\\\"link-internal\\\" href=\\\"40\\\">contact form<\\/a>, by means of which you can send us news. In this process your data is transferred in an encrypted form. All the data fields marked as mandatory must be filled out in order to allow us to process your request. If you do not provide this information, we are unable to process your request. Any further provision of data is voluntary. We process the data for the purpose of responding to your enquiry.<\\/p>\\r\\n<p>The legal base for the data processing is Article 6 (1) 1st sentence point (b) GDPR.<\\/p>\",\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:633:\\\"<div><p>Unsere Website enth\\u00e4lt ein <a class=\\\"link-internal\\\" href=\\\"t3:\\/\\/page?uid=14\\\">Kontaktformular<\\/a>, \\u00fcber welches Sie uns Nachrichten schicken k\\u00f6nnen. Der Transfer Ihrer Daten erfolgt dabei verschl\\u00fcsselt. Alle als Pflichtfelder gekennzeichneten Datenfelder sind zur Bearbeitung Ihres Anliegens erforderlich. Eine Nichtbereitstellung hat zur Folge, dass wir Ihr Anliegen nicht bearbeiten k\\u00f6nnen. Die Bereitstellung von weiteren Daten erfolgt freiwillig. Wir verarbeiten die Daten zu dem Zweck, Ihre Anfrage zu beantworten.<\\/p><\\/div>\\r\\n<div><p>Rechtgrundlage f\\u00fcr die Datenverarbeitung ist Art. 6 Abs. 1 S. 1 b DSGVO.<\\/p><\\/div>\\\";}\"}}',0),(4208,0,1628603221,2,'BE',1,0,59,'tt_content','{\"oldRecord\":{\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"},\"newRecord\":{\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:167:\\\"Sie erreichen den externen Datenschutzbeauftragten der SLUB unter folgender E-Mail-Adresse: <LINK datenschutz@slub-dresden.de>datenschutz@slub-dresden.de <br \\/><\\/link>\\\";}\"}}',0),(4209,0,1628603221,2,'BE',1,0,54,'tt_content','{\"oldRecord\":{\"bodytext\":\"<div><p>Unsere Website enth\\u00e4lt ein <a class=\\\"link-internal\\\" href=\\\"t3:\\/\\/page?uid=14\\\">Kontaktformular<\\/a>, \\u00fcber welches Sie uns Nachrichten schicken k\\u00f6nnen. Der Transfer Ihrer Daten erfolgt dabei verschl\\u00fcsselt. Alle als Pflichtfelder gekennzeichneten Datenfelder sind zur Bearbeitung Ihres Anliegens erforderlich. Eine Nichtbereitstellung hat zur Folge, dass wir Ihr Anliegen nicht bearbeiten k\\u00f6nnen. Die Bereitstellung von weiteren Daten erfolgt freiwillig. Wir verarbeiten die Daten zu dem Zweck, Ihre Anfrage zu beantworten.<\\/p><\\/div>\\r\\n<div><p>Rechtgrundlage f\\u00fcr die Datenverarbeitung ist Art. 6 Abs. 1 S. 1 b DSGVO.<\\/p><\\/div>\",\"l18n_diffsource\":\"a:23:{s:5:\\\"CType\\\";N;s:6:\\\"colPos\\\";N;s:6:\\\"header\\\";N;s:13:\\\"header_layout\\\";N;s:15:\\\"header_position\\\";N;s:4:\\\"date\\\";N;s:11:\\\"header_link\\\";N;s:9:\\\"subheader\\\";N;s:8:\\\"bodytext\\\";N;s:6:\\\"layout\\\";N;s:11:\\\"frame_class\\\";N;s:18:\\