i der Nutzung der Website erfassen wir Informationen, die Sie selbst bereitstellen. Au\\u00dferdem werden w\\u00e4hrend Ihres Besuchs auf der Website automatisch bestimmte Informationen \\u00fcber Ihre Nutzung der Website durch uns erfasst.<br \\/><br \\/><\\/div>\\r\\n<div>Wir verarbeiten personenbezogene Daten unter Beachtung der einschl\\u00e4gigen Datenschutzvorschriften, insbesondere der DSGVO und des BDSG. Eine Datenverarbeitung durch uns findet nur auf der Grundlage einer gesetzlichen Erlaubnis statt. Bei der Nutzung dieser Website verarbeiten wir personenbezogene Daten nur mit Ihrer Einwilligung (Art. 6 Abs. 1 S. 1 a DSGVO), zur Erf\\u00fcllung eines Vertrags, dessen Vertragspartei Sie sind, oder auf Ihre Anfrage zur Durchf\\u00fchrung vorvertraglicher Ma\\u00dfnahmen (Art. 6 Abs. 1 S. 1 b DSGVO), zur Erf\\u00fcllung einer rechtlichen Verpflichtung (Art. 6 Abs.1 S. 1 c DSGVO) oder wenn die Verarbeitung zu Wahrung unser berechtigten Interessen oder den berechtigten Interessen eines Dritten erforderlich ist, sofern nicht Ihre Interessen oder Grundrechte und Grundfreiheiten, die den Schutz personenbezogener Daten erfordern, \\u00fcberwiegen (Art. 6 Abs. 1 S. 1 f DSGVO).&nbsp;<\\/div>\\r\\n<h4>Dauer der Speicherung<\\/h4>\\r\\n<div>Sofern sich aus den folgenden Hinweisen nichts Anderes ergibt, speichern wir die Daten nur solange, wie es zur Erreichung des Verarbeitungszwecks oder f\\u00fcr die Erf\\u00fcllung unserer vertraglichen oder gesetzlichen Pflichten erforderlich ist. Solche gesetzlichen Aufbewahrungspflichten k\\u00f6nnen sich insbesondere aus handels- oder steuerrechtlichen Vorschriften ergeben.<\\/div>\\r\\n<div><\\/div>\\\";}\"}}',0),(4881,0,1628603455,2,'BE',1,0,152,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>Our website includes a <a class=\\\"link-internal\\\" href=\\\"t3:\\/\\/page?uid=14\\\">contact form<\\/a>, by means of which you can send us news. In this process your data is transferred in an encrypted form. All the data fields marked as mandatory must be filled out in order to allow us to process your request. If you do not provide this information, we are unable to process your request. Any further provision of data is voluntary. We process the data for the purpose of responding to your enquiry.<\\/p>\\r\\n<p>The legal base for the data processing is Article 6 (1) 1st sentence point (b) GDPR.<\\/p>\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"},\"newRecord\":{\"bodytext\":\"<p>Our website includes a <a class=\\\"link-internal\\\" href=\\\"67\\\">contact form<\\/a>, by means of which you can send us news. In this process your data is transferred in an encrypted form. All the data fields marked as mandatory must be filled out in order to allow us to process your request. If you do not provide this information, we are unable to process your request. Any further provision of data is voluntary. We process the data for the purpose of responding to your enquiry.<\\/p>\\r\\n<p>The legal base for the data processing is Article 6 (1) 1st sentence point (b) GDPR.<\\/p>\",\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:633:\\\"<div><p>Unsere Website enth\\u00e4lt ein <a class=\\\"link-internal\\\" href=\\\"t3:\\/\\/page?uid=14\\\">Kontaktformular<\\/a>, \\u00fcber welches Sie uns Nachrichten schicken k\\u00f6nnen. Der Transfer Ihrer Daten erfolgt dabei verschl\\u00fcsselt. Alle als Pflichtfelder gekennzeichneten Datenfelder sind zur Bearbeitung Ihres Anliegens erforderlich. Eine Nichtbereitstellung hat zur Folge, dass wir Ihr Anliegen nicht bearbeiten k\\u00f6nnen. Die Bereitstellung von weiteren Daten erfolgt freiwillig. Wir verarbeiten die Daten zu dem Zweck, Ihre Anfrage zu beantworten.<\\/p><\\/div>\\r\\n<div><p>Rechtgrundlage f\\u00fcr die Datenverarbeitung ist Art. 6 Abs. 1 S. 1 b DSGVO.<\\/p><\\/div>\\\";}\"}}',0),(4882,0,1628603455,2,'BE',1,0,141,'tt_content','{\"