ches Sie uns Nachrichten schicken k\\u00f6nnen. Der Transfer Ihrer Daten erfolgt dabei verschl\\u00fcsselt. Alle als Pflichtfelder gekennzeichneten Datenfelder sind zur Bearbeitung Ihres Anliegens erforderlich. Eine Nichtbereitstellung hat zur Folge, dass wir Ihr Anliegen nicht bearbeiten k\\u00f6nnen. Die Bereitstellung von weiteren Daten erfolgt freiwillig. Wir verarbeiten die Daten zu dem Zweck, Ihre Anfrage zu beantworten.<\\/p><\\/div>\\r\\n<div><p>Rechtgrundlage f\\u00fcr die Datenverarbeitung ist Art. 6 Abs. 1 S. 1 b DSGVO.<\\/p><\\/div>\",\"l18n_diffsource\":\"a:1:{s:8:\\\"bodytext\\\";N;}\"}}',0),(4884,0,1628603455,2,'BE',1,0,123,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>Auf dieser Seite dokumentieren wir \\u00c4nderungen an der DFG-Viewer Webseite und am DFG-Viewer selbst. So k\\u00f6nnen Sie nachvollziehen, ob k\\u00fcrzlich \\u00c4nderungen vorgenommen wurden.<\\/p>\\r\\n<p>Wenn Sie Fehler feststellen oder Verbesserungsvorschl\\u00e4ge haben, k\\u00f6nnen Sie uns auf den gewohnten Kan\\u00e4len kontaktieren. Siehe Seite <a class=\\\"link-internal\\\" href=\\\"t3:\\/\\/page?uid=14\\\">Kontakt<\\/a>.<\\/p>\",\"l18n_diffsource\":\"a:23:{s:5:\\\"CType\\\";N;s:6:\\\"colPos\\\";N;s:6:\\\"header\\\";N;s:13:\\\"header_layout\\\";N;s:15:\\\"header_position\\\";N;s:4:\\\"date\\\";N;s:11:\\\"header_link\\\";N;s:9:\\\"subheader\\\";N;s:8:\\\"bodytext\\\";N;s:6:\\\"layout\\\";N;s:11:\\\"frame_class\\\";N;s:18:\\\"space_before_class\\\";N;s:17:\\\"space_after_class\\\";N;s:12:\\\"sectionIndex\\\";N;s:9:\\\"linkToTop\\\";N;s:16:\\\"sys_language_uid\\\";N;s:6:\\\"hidden\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;s:8:\\\"fe_group\\\";N;s:8:\\\"editlock\\\";N;s:10:\\\"categories\\\";N;s:14:\\\"rowDescription\\\";N;}\"},\"newRecord\":{\"bodytext\":\"<p>Auf dieser Seite dokumentieren wir \\u00c4nderungen an der DFG-Viewer Webseite und am DFG-Viewer selbst. So k\\u00f6nnen Sie nachvollziehen, ob k\\u00fcrzlich \\u00c4nderungen vorgenommen wurden.<\\/p>\\r\\n<p>Wenn Sie Fehler feststellen oder Verbesserungsvorschl\\u00e4ge haben, k\\u00f6nnen Sie uns auf den gewohnten Kan\\u00e4len kontaktieren. Siehe Seite <a class=\\\"link-internal\\\" href=\\\"67\\\">Kontakt<\\/a>.<\\/p>\",\"l18n_diffsource\":\"a:1:{s:8:\\\"bodytext\\\";N;}\"}}',0),(4885,0,1628603455,2,'BE',1,0,112,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>Das verwendete Metadatenformat ist ausf\\u00fchrlich dokumentiert und mit Beispielen versehen. Die beschriebene Minimalversion kann sehr leicht aus vorhandenen Metadaten anderer Formate erzeugt werden und gen\\u00fcgt bereits, um den <em>Viewer<\\/em> anzusprechen. Das Format ist aber gleichzeitig flexibel und erweiterbar genug, um auch deutlich umfangreichere Strukturen und ausf\\u00fchrlichere Metadaten verschiedenster Formate abbilden zu k\\u00f6nnen.<\\/p>\\r\\n<p>Das METS-Profil stellt das Containerformat dar, das die Struktur eines Dokuments abbildet und dessen bibliographische Metadaten aufnehmen kann.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=10\\\" title=\\\"(engl.) metadata encoding and transmission standard; (dt.) Metadatenkodierungs- und \\u00fcbertragungsstandard\\\">METS-Dokumentation herunterladen!<\\/a><\\/p>\\r\\n<p>Zum Abbilden der bibliographischen Metadaten verwendet der <em>DFG-Viewer<\\/em> das MODS- oder TEI-Format. Es kann nahtlos in die METS-Datei eingebettet und auch durch weitere Datenformate erg\\u00e4nzt werden.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=12\\\" title=\\\"(engl.) metadata object description schema; (dt.) Schema zur Beschreibung der Metadaten eines Objekts\\\">MODS-Dokumentation herunterladen!<\\/a><br \\/> <a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=15\\\" title=\\\"(engl.) text encoding initiative; (dt.) Textkodierungsinitiative\\\">TEI-Dokumentation herunterladen!<\\/a><\\/p>\\r\\n<p>In der METS-Datei kann eine Suche im Volltext \\u00fcber SRU hinterlegt werden. Der DFG-Viewer \\u00fcbernimmt die Abfrage und Visualisierung der Suchergebnisse.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=14\\\">SRU-Dokumentation herunterladen!<\\/a><\\/p>\",\"l18n_diffsource\":\"a:23:{s:5:\\\"CType\\\";N;s:6:\\\"colPos\\\";N;s:6:\\\"header\\\";N;s:13:\\\"header_layout\\\";N;s:15:\\\"header_position\\\";N;s:4:\\\"date\\\";N;s:11:\\\"header_link\\\";N;s:9:\\\"subheader\\\";N;s:8:\\\"bodytext\\\";N;s:6:\\\"layout\\\";N;s:11:\\\"frame_class\\\";N;s:18:\\\"space_before_class\\\";N;s:17:\\\"space_after_class\\\";N;s:12:\\\"sectionIndex\\\";N;s:9:\\\"linkToTop\\\";N;s:16:\\\"sys_language_uid\\\";N;s:6:\\\"hidden\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;s:8:\\\"fe_group\\\";N;s:8:\\\"editlock\\\";N;s:10:\\\"categories\\\";N;s:14:\\\"rowDescription\\\";N;}\"},\"newRecord\":{\"bodytext\":\"<p>Das verwendete Metadatenformat ist ausf\\u00fchrlich dokumentiert und mit Beispielen versehen. Die beschriebene Minimalversion kann sehr leicht aus vorhandenen Metadaten anderer Formate erzeugt werden und gen\\u00fcgt bereits, um den <em>Viewer<\\/em> anzusprechen. Das Format ist aber gleichzeitig flexibel und erweiterbar genug, um auch deutlich umfangreichere Strukturen und ausf\\u00fchrlichere Metadaten verschiedenster Formate abbilden zu k\\u00f6nnen.<\\/p>\\r\\n<p>Das METS-Profil stellt das Containerformat dar, das die Struktur eines Dokuments abbildet und dessen bibliographische Metadaten aufnehmen kann.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:9\\\" title=\\\"(engl.) metadata encoding and transmission standard; (dt.) Metadatenkodierungs- und \\u00fcbertragungsstandard\\\">METS-Dokumentation herunterladen!<\\/a><\\/p>\\r\\n<p>Zum Abbilden der bibliographischen Metadaten verwendet der <em>DFG-Viewer<\\/em> das MODS- oder TEI-Format. Es kann nahtlos in die METS-Datei eingebettet und auch durch weitere Datenformate erg\\u00e4nzt werden.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:10\\\" title=\\\"(engl.) metadata object description schema; (dt.) Schema zur Beschreibung der Metadaten eines Objekts\\\">MODS-Dokumentation herunterladen!<\\/a><br \\/> <a class=\\\"link-download\\\" href=\\\"file:11\\\" title=\\\"(engl.) text encoding initiative; (dt.) Textkodierungsinitiative\\\">TEI-Dokumentation herunterladen!<\\/a><\\/p>\\r\\n<p>In der METS-Datei kann eine Suche im Volltext \\u00fcber SRU hinterlegt werden. Der DFG-Viewer \\u00fcbernimmt die Abfrage und Visualisierung der Suchergebnisse.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:12\\\">SRU-Dokumentation herunterladen!<\\/a><\\/p>\",\"l18n_diffsource\":\"a:1:{s:8:\\\"bodytext\\\";N;}\"}}',0),(4886,0,1628603455,2,'BE',1,0,111,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>The metadata format used is documented comprehensively and illustrated with the help of examples. The minimal version described can be generated very easily from existing metadata of other formats and is already sufficient to address the <em>Viewer<\\/em>. However, at the same time, the format is flexible and expandable enough to be able to represent considerably more comprehensive structures and more extensive metadata of diverse formats.<\\/p>\\r\\n<p>The METS profile constitutes the container format which represents the structure of a document and can comprise its bibliographic metadata.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=11\\\" title=\\\"TEXT, METS application profile 2.2, METS_application_profile_2.2.pdf, 697 KB\\\">Download METS documentation!<\\/a><\\/p>\\r\\n<p>The <em>DFG Viewer<\\/em> uses the MODS or TEI format to display the bibliographic metadata. It can be integrated into the METS file seamlessly and can also be supplemented with further data formats there.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=13\\\" title=\\\"metadata object description schema\\\">Download MODS documentation!<\\/a><br \\/> <a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=16\\\" title=\\\"text encoding initiative\\\">Download TEI documentation!<\\/a><\\/p>\\r\\n<p>The METS-file may contain a reference to search in fulltext via SRU. The DFG-Viewer will search, retrieve and present the results.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"t3:\\/\\/file?uid=14\\\">SRU-Dokumentation herunterladen!<\\/a><\\/p>\",\"l18n_diffsource\":\"a:3:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;}\"},\"newRecord\":{\"bodytext\":\"<p>The metadata format used is documented comprehensively and illustrated with the help of examples. The minimal version described can be generated very easily from existing metadata of other formats and is already sufficient to address the <em>Viewer<\\/em>. However, at the same time, the format is flexible and expandable enough to be able to represent considerably more comprehensive structures and more extensive metadata of diverse formats.<\\/p>\\r\\n<p>The METS profile constitutes the container format which represents the structure of a document and can comprise its bibliographic metadata.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:13\\\" title=\\\"TEXT, METS application profile 2.2, METS_application_profile_2.2.pdf, 697 KB\\\">Download METS documentation!<\\/a><\\/p>\\r\\n<p>The <em>DFG Viewer<\\/em> uses the MODS or TEI format to display the bibliographic metadata. It can be integrated into the METS file seamlessly and can also be supplemented with further data formats there.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:14\\\" title=\\\"metadata object description schema\\\">Download MODS documentation!<\\/a><br \\/> <a class=\\\"link-download\\\" href=\\\"file:15\\\" title=\\\"text encoding initiative\\\">Download TEI documentation!<\\/a><\\/p>\\r\\n<p>The METS-file may contain a reference to search in fulltext via SRU. The DFG-Viewer will search, retrieve and present the results.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:12\\\">SRU-Dokumentation herunterladen!<\\/a><\\/p>\",\"l18n_diffsource\":\"a:4:{s:11:\\\"l18n_parent\\\";N;s:9:\\\"starttime\\\";i:0;s:7:\\\"endtime\\\";i:0;s:8:\\\"bodytext\\\";s:1655:\\\"<p>Das verwendete Metadatenformat ist ausf\\u00fchrlich dokumentiert und mit Beispielen versehen. Die beschriebene Minimalversion kann sehr leicht aus vorhandenen Metadaten anderer Formate erzeugt werden und gen\\u00fcgt bereits, um den <em>Viewer<\\/em> anzusprechen. Das Format ist aber gleichzeitig flexibel und erweiterbar genug, um auch deutlich umfangreichere Strukturen und ausf\\u00fchrlichere Metadaten verschiedenster Formate abbilden zu k\\u00f6nnen.<\\/p>\\r\\n<p>Das METS-Profil stellt das Containerformat dar, das die Struktur eines Dokuments abbildet und dessen bibliographische Metadaten aufnehmen kann.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:9\\\" title=\\\"(engl.) metadata encoding and transmission standard; (dt.) Metadatenkodierungs- und \\u00fcbertragungsstandard\\\">METS-Dokumentation herunterladen!<\\/a><\\/p>\\r\\n<p>Zum Abbilden der bibliographischen Metadaten verwendet der <em>DFG-Viewer<\\/em> das MODS- oder TEI-Format. Es kann nahtlos in die METS-Datei eingebettet und auch durch weitere Datenformate erg\\u00e4nzt werden.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:10\\\" title=\\\"(engl.) metadata object description schema; (dt.) Schema zur Beschreibung der Metadaten eines Objekts\\\">MODS-Dokumentation herunterladen!<\\/a><br \\/> <a class=\\\"link-download\\\" href=\\\"file:11\\\" title=\\\"(engl.) text encoding initiative; (dt.) Textkodierungsinitiative\\\">TEI-Dokumentation herunterladen!<\\/a><\\/p>\\r\\n<p>In der METS-Datei kann eine Suche im Volltext \\u00fcber SRU hinterlegt werden. Der DFG-Viewer \\u00fcbernimmt die Abfrage und Visualisierung der Suchergebnisse.<\\/p>\\r\\n<p class=\\\"abstract\\\"><a class=\\\"link-download\\\" href=\\\"file:12\\\">SRU-Dokumentation herunterladen!<\\/a><\\/p>\\\";}\"}}',0),(4887,0,1628603455,2,'BE',1,0,16,'tx_news_domain_model_news','{\"oldRecord\":{\"l10n_diffsource\":\"a:27:{s:4:\\\"type\\\";N;s:9:\\\"istopnews\\\";N;s:5:\\\"title\\\";N;s:12:\\\"path_segment\\\";N;s:6:\\\"teaser\\\";N;s:8:\\\"datetime\\\";N;s:7:\\\"archive\\\";N;s:8:\\\"bodytext\\\";N;s:16:\\\"content_elements\\\";N;s:9:\\\"fal_media\\\";N;s:17:\\\"fal_related_files\\\";N;s:10:\\\"categories\\\";N;s:7:\\\"related\\\";N;s:13:\\\"related_links\\\";N;s:4:\\\"tags\\\";N;s:6:\\\"author\\\";N;s:12:\\\"author_email\\\";N;s:8:\\\"keywords\\\";N;s:11:\\\"description\\\";N;s:17:\\\"alternative_title\\\";N;s:16:\\\"sys_language_uid\\\";N;s:6:\\\"hidden\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;s:8:\\\"fe_group\\\";N;s:8:\\\"editlock\\\";N;s:5:\\\"notes\\\";N;}\"},\"newRecord\":{\"l10n_diffsource\":\"a:1:{s:8:\\\"bodytext\\\";N;}\"}}',0),(4888,0,1628603455,2,'BE',1,0,15,'tx_news_domain_model_news','{\"oldRecord\":{\"l10n_diffsource\":\"a:27:{s:4:\\\"type\\\";N;s:9:\\\"istopnews\\\";N;s:5:\\\"title\\\";N;s:12:\\\"path_segment\\\";N;s:6:\\\"teaser\\\";N;s:8:\\\"datetime\\\";N;s:7:\\\"archive\\\";N;s:8:\\\"bodytext\\\";N;s:16:\\\"content_elements\\\";N;s:9:\\\"fal_media\\\";N;s:17:\\\"fal_related_files\\\";N;s:10:\\\"categories\\\";N;s:7:\\\"related\\\";N;s:13:\\\"related_links\\\";N;s:4:\\\"tags\\\";N;s:6:\\\"author\\\";N;s:12:\\\"author_email\\\";N;s:8:\\\"keywords\\\";N;s:11:\\\"description\\\";N;s:17:\\\"alternative_title\\\";N;s:16:\\\"sys_language_uid\\\";N;s:6:\\\"hidden\\\";N;s:9:\\\"starttime\\\";N;s:7:\\\"endtime\\\";N;s:8:\\\"fe_group\\\";N;s:8:\\\"editlock\\\";N;s:5:\\\"notes\\\";N;}\"},\"newRecord\":{\"l10n_diffsource\":\"a:1:{s:8:\\\"bodytext\\\";N;}\"}}',0),(4889,0,1628603474,4,'BE